", \"partial\", \"not_achieved\"\n\n  // Remuneration data (for indicators)\n  incentive_amount Float  @default(0)\n  max_remuneration Float?\n  raw_percentage   Float?\n\n  // Metadata\n  calculation_date    DateTime @default(now())\n  calculation_version String   @default(\"1.0\")\n\n  // Historical accuracy fields\n  kpi_config_snapshot           Json?\n  remuneration_formula_snapshot Json?\n  worker_allocation_snapshot    Json?\n  calculation_metadata          Json?\n\n  facility  Facility   @relation(fields: [facility_id], references: [id], onDelete: Cascade)\n  indicator Indicator? @relation(fields: [indicator_id], references: [id], onDelete: Cascade)\n\n  @@unique([facility_id, report_month, indicator_id])\n  @@index([facility_id, report_month])\n  @@index([report_month])\n  @@index([indicator_id])\n  @@index([calculation_version])\n}\n\nenum UserRole {\n  admin\n  facility\n\n  @@map(\"user_role\")\n}\n\nenum UserType {\n  ADMIN\n  FACILITY\n}\n\nenum FieldType {\n  CONSTANT\n  FACILITY_SPECIFIC\n  MONTHLY_COUNT\n  BINARY\n  PERCENTAGE\n  CALCULATED\n  INDICATOR_REFERENCE\n  FACILITY_TYPE_SPECIFIC\n}\n\nenum ValidationRule {\n  REQUIRED\n  POSITIVE_NUMBER\n  PERCENTAGE_RANGE\n  DATE_RANGE\n  CUSTOM_FORMULA\n  BINARY_ONLY\n  MIN_VALUE\n  MAX_VALUE\n}\n\nenum CalculationType {\n  DIRECT_INPUT\n  CALCULATED\n  AGGREGATED\n  PERCENTAGE\n\n  @@map(\"calculation_type\")\n}\n\nenum DataQuality {\n  PENDING\n  VALIDATED\n  APPROVED\n  REJECTED\n\n  @@map(\"data_quality\")\n}\n\nenum UploadStatus {\n  PROCESSING\n  COMPLETED\n  FAILED\n  CANCELLED\n\n  @@map(\"upload_status\")\n}\n\nenum TargetType {\n  PERCENTAGE\n  CONSTANT_VALUE\n  BINARY\n  RANGE\n  MINIMUM_THRESHOLD\n  MAXIMUM_THRESHOLD\n  PERCENTAGE_RANGE\n\n  @@map(\"target_type\")\n}\n\nenum FieldCategory {\n  DATA_FIELD\n  TARGET_FIELD\n\n  @@map(\"field_category\")\n}\n\nenum formula_type {\n  RANGE_BASED\n  PERCENTAGE_CAP\n  BINARY\n  THRESHOLD_BONUS\n  MINIMUM_THRESHOLD\n  PERCENTAGE_RANGE\n}\n",
